import AboutPage from "../About/AboutPage";
import WorkPage from "../Work/WorkPage";
import RotatingWords from "../RotatingWords/RotatingWords";
import './title.css'
import NavButton from "../Buttons/NavButton";
import Projects from "../Projects/Projects";
import { Button } from "react-bootstrap";
import Contact from "../Contact/Contact";
import { useState, useEffect } from "react";

export default function HomePage(){
    const [isMobile, setIsMobile] = useState(false);
    
    useEffect(() => {
        const checkMobile = () => {
            setIsMobile(window.innerWidth <= 768);
        };
        
        // Initial check
        checkMobile();
        
        // Add event listener
        window.addEventListener('resize', checkMobile);
        
        // Cleanup
        return () => window.removeEventListener('resize', checkMobile);
    }, []);

    const handleClick = (section) => {
        if (section === "Contact"){
            setShowContact(true);
            return;
        } 
        const element = document.getElementById(section);
        if (element) {
            if (section === "Home"){
                window.scrollTo(0,0);
                return;
            }
            const scrollOffset = 35;
            window.scrollBy({ top: element.getBoundingClientRect().top + scrollOffset, behavior: 'smooth' });
            }      
        };
        const [showContact, setShowContact] = useState(false)

    return (
         <> 
         <Contact showContact={showContact} onClose={() => setShowContact(false)}/>

         <div className="video-background" id="Home">
            <video src="background.mp4" muted autoPlay loop id="myVideo"></video>
            <br />
            <div className="text-overlay">
                <p className="intro-text">Hi my name is </p>
                <h1 className="color-change">Joseph Agarwal</h1>
                <p><RotatingWords /></p>
                <NavButton handleClick={handleClick}/>
                <br />
                <br />
            </div>
         </div>

        <div style={{backgroundImage: `url('background.png')`, backgroundRepeat:'no-repeat', backgroundSize: 'cover', backgroundPosition: 'center'}}>      
            <div> 
                <h1 id="About Me" style={{
                    fontFamily:'Franklin Gothic Medium', 
                    fontSize: isMobile ? '2.5rem' : '4.5rem', 
                    color: 'black', 
                    paddingTop: 30, 
                    marginBottom: -15,
                    textAlign: 'center'
                }}>
                    <Button onClick={() => handleClick('Home')} className='buttonClass' variant="dark">↑</Button>{' '}
                        About Me
                    <Button onClick={() => handleClick('Experience')} className='buttonClass' variant="dark">↓</Button>{' '}
                </h1> 
            </div>
            <AboutPage />
            <div className="ladder-img" style={{
                display: isMobile ? 'none' : 'block',
                zIndex: 100, 
                position: 'absolute', 
                right: '5%', 
                marginTop: -150
            }}>
                <img src="ladder.png" width={isMobile ? 200 : 340} alt="Ladder" />
            </div>
            <br />
        </div> 

        <div style={{backgroundImage: `url('work.png')`, backgroundRepeat:'no-repeat', backgroundSize: 'cover', backgroundPosition: 'center', width: "100%"}}>   
            <div id="Experience"> 
                <h1 style={{
                    fontFamily: 'Franklin Gothic Medium', 
                    fontSize: isMobile ? '2.5rem' : '4.5rem', 
                    color: 'white', 
                    paddingTop: 30, 
                    zIndex: 2,
                    textAlign: 'center'
                }}>
                    <Button onClick={() => handleClick('About Me')} className='buttonClass' variant="dark">↑</Button>{' '}
                    Experience
                    <Button onClick={() => handleClick('Projects')} className='buttonClass' variant="dark">↓</Button>{' '}
                </h1> 
            </div>  
            <WorkPage />
            </div>
            <div className="ladder-img" style={{
                display: isMobile ? 'none' : 'block',
                zIndex: 100, 
                position: 'absolute', 
                left: '5%', 
                marginTop: -110
            }}>
                <img src="ladder.png" width={isMobile ? 150 : 240} alt="Ladder" />
            </div> 
            
            <div style={{backgroundImage: `url('work.svg')`, backgroundRepeat:'no-repeat', backgroundSize: 'cover', backgroundPosition: 'center'}}>   

            <div id="Projects"> 
                <h1 style={{
                    fontFamily: 'Franklin Gothic Medium', 
                    fontSize: isMobile ? '2.5rem' : '4.5rem', 
                    color: 'black', 
                    paddingTop: 35, 
                    marginBottom: -15,
                    textAlign: 'center'
                }}>
                    <Button onClick={() => handleClick('Experience')} className='buttonClass' variant="dark">↑</Button>{' '}
                    Projects
                </h1> 
            </div>   
            <Projects />
            <div style={{textAlign: 'center', paddingBottom: '30px'}}>
                <Button onClick={() => handleClick('Home')} className='buttonClass' variant="dark">Back to the top</Button>{' '}
            </div>
            </div>
        </>)
}
